import React from 'react'
import {makeStyle, makeStyles} from "@material-ui/styles"
import {Typography, Box, Grid, Avatar} from "@material-ui/core"
import Navbar from "./Navbar";
import silas_image from"../images/Silas.jpg"

const useStyle = makeStyles({
    container : {
        background:"tomato",
        width: "40%",
        alignContent:"center",
        margin: "auto",   
        padding: "10px",             
    },
    silasIcon:{
        width: "30%",
    }

})

export const Resume = () => {
    const classes = useStyle()
    return (
        <div>
           <Navbar/>
           <Grid container spacing={3} className={classes.container}>
               <Grid item xs={3}  className={classes.silasIcon}>
                   <Avatar src={silas_image}/>
               </Grid>
               <Grid item xs={6}>
                   <Typography variant="h2" >SILAS</Typography>
                   <Typography variant="h5" >Web Programmer</Typography>
                   <Typography variant="h3" >About Me</Typography>
                   <Typography variant="p" >Hi, It is my Resume, please contact me for getting more information</Typography>
               </Grid>
           </Grid>
        </div>
    )
}

export default Resume;
